import { Provider } from 'react-redux';
// import mystore from "./storeandreducer/store";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      {/* <BrowserRouter> */}
      {/* <Provider store={mystore}> */}

        <App />
        {/* </Provider> */}

      {/* </BrowserRouter> */}

